import React from "react";
import './footer.css'; 
import MediaLink from "./MediaLink/mediaLink";
import "../../assets/images/."

const Footer = () => {
    return (
        <section id="footer">
            <div className="footerContent">
                <MediaLink mediaLink="https://www.linkedin.com/in/Jacqueline-Zamitalo/" className="lnLink" imgSrc="src/assets/images/linkedIn_icon.png"></MediaLink>
                <MediaLink mediaLink="https://www.github.com/JackiZam" className="ghLink" imgSrc="src/assets/images/github_icon.png"></MediaLink>
                <p>Created by Jacqueline Zamitalo</p>
            </div>
        </section>
    )
}

export default Footer;
